  `},{id:14,title:"Separate Ways DLC Launches for Resident Evil 4",date:"2023-09-15",image:"https://game.capcom.com/residentevil/share/news/uploads/2023/09/game_eyecatch-230921-re.jpg",category:"Game",content:`
